function useRefExample(){

    const[ input,setinput]=useState("");
    console.log("getting render");

    return (
        <div>
            <h1>Input</h1>
            <input 
            type="text"
            value={input}
            onChange={(e)=>setinput(e.target.value)}/>
        </div>
    )
}
